import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap';
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
import axios from 'axios';

const ReadOrderDetails = () => {
  const [orders, setOrders] = useState([]);

  const [open, SetOpen] = useState(false); //open place order 

  const handleOpen = () => {
    SetOpen(true) //open place order 
  }
  const handleClose = () => {
    SetOpen(false) //close place order 
  }

  //save data in list
  const getOrders = async () => {
    const result = await axios.get('http://localhost:8080/getcustomerorders')
    console.log(result.data);
    setOrders(result.data);
  };

  useEffect(() => {
    getOrders();
  }, []);

  //   const deleteEmployee = async(displayOrderId)=>{
  //     await axios.delete(`http://localhost:8080/deleteorder/${displayOrderId}`)
  //     getOrders();

  // }
  return (
    <div>
      <div style={{
        marginTop: "100px", marginLeft: "50px",
        overflow: "auto", width: "1000px", height: "400px", boxShadow: ' 5px 5px 10px #808080'
      }}>
        <Grid align='right'>
          <Button variant="contained" open={open} handleClose={handleClose}>Plade Order</Button>
        </Grid>
        <h1 style={{ background: "#87CEFA", textAlign: 'center', color: "white" }}>Read Order Details </h1>
        <Table striped bordered hover size="sm">
          <thead className='thead-dark'>
            <tr>
              <th>displayOrderId</th>
              <th>customerName </th>
              <th>productName</th>
              <th>mobileNo</th>
              <th>modelNo</th>
              <th>brandName</th>
              <th>ProductColor </th>
              <th>category</th>
              <th>subCategory</th>
              <th>discription</th>
              <th>orderDate </th>
              <th>expectedDeliveryDate</th>
              <th>logisticName</th>
              <th>awbNo</th>
              <th>couponCode </th>
              <th>action </th>
            </tr>
          </thead>
          <tbody >
            {
              orders.map((orders) => {
                return (
                  <tr key={orders.displayOrderId}>
                    <td >{orders.displayOrderId}</td>
                    <td>{orders.customerName}</td>
                    <td>{orders.productName}</td>
                    <td>{orders.mobileNo}</td>
                    <td>{orders.modelNo}</td>
                    <td>{orders.brandName}</td>
                    <td>{orders.ProductColor}</td>
                    <td>{orders.category}</td>
                    <td>{orders.subCategory}</td>
                    <td>{orders.discription}</td>
                    <td>{orders.orderDate}</td>
                    <td>{orders.expectedDeliveryDate}</td>
                    <td>{orders.logisticName}</td>
                    <td>{orders.awbNo}</td>
                    <td>{orders.couponCode}</td>
                    <td><Button variant="primary">Edit</Button></td>
                    <td> <Button variant="outline-primary">Veiw</Button></td>
                    <td> <Button variant="danger">Delete</Button></td>
                  </tr>
                )
              })
            }
          </tbody>
        </Table>
      </div>
    </div>
  );
}

export default ReadOrderDetails
